import React from 'react';
import { ItemType } from './types';

export interface ItemGridProp{
  data: ItemType[]
  clickedItem: (value: any) => {}
}

export interface GridItemProps extends ItemType{
  clicked: (value: number) => {}
}

export const GridItem = (props: GridItemProps) => (
  <img onClick={() => {console.log(props.id);props.clicked(props.id)}} 
      key={props.id} 
      alt={props.image} 
      style={{width: '25%'}} 
      src={props.image}/>
)
const ItemGrid = (props: ItemGridProp) => {
  return <div style={{flex: 1}}>
    {props.data.map((item: ItemType) => {
      <img onClick={() => {console.log(item.id);props.clickedItem(item.id)}} 
      key={item.id} 
      alt={item.image} 
      style={{width: '25%'}} 
      src={item.image}/>}
      )}
  </div>
}

export default ItemGrid
